/**
 * My loading screen
 * @class
 * @extends cc.LoaderScene
 */

LoaderScene = cc.LoaderScene.extend({
    _logo:new Image(),

    /**
     * Constructor
     */
    ctor:function () {
        //this._logo.src = "data:image/jpeg;base64,";
    	//cc.TextureCache.getInstance().addImage(s_LoadingBackground);
    	this._logo.src = "data:image/png;base64,";
        this._logo.width = 960;
        this._logo.height = 540;
        //cc.log("my loaderScene");
    },

    /**
     * Draw loading screen
     */
    draw:function () {
    	//cc.log(cc.canvas.width + " " + cc.canvas.height);
        var logoWidth = (cc.canvas.width - this._logo.width) / 2;
        var logoHeight = (cc.canvas.height - this._logo.height) / 2;
        cc.renderContext.clearRect(0, -cc.canvas.height, cc.canvas.width, cc.canvas.height);
        cc.renderContext.fillStyle = "#202020";
        cc.renderContext.fillRect(0, -cc.canvas.height, cc.canvas.width, cc.canvas.height);
        cc.drawingUtil.drawImage(this._logo, cc.p(logoWidth, logoHeight));
        cc.renderContext.fillStyle = "#b2b4b3";
        cc.renderContext.font = 'Bold 36px Verdana';
        cc.renderContext.textAlign = 'center';
        cc.drawingUtil.fillText("Loading " + cc.Loader.getInstance().getProgressBar() + "%", this._logo.width / 2, this._logo.height / 4);
        //cc.log("drawing");
    }
});

/**
 * My loader scene
 * @return {LoaderScene}
 */
LoaderScene.getInstance = function () {
    if (!this._instance) {
        this._instance = new LoaderScene();
    }
    return this._instance;
};

LoaderScene._instance = null;